import React from "react";

const Map = () => {
  return (
    <div class="container section negative-margin">
      <div class="row">
        <div class="col-sm-12">
          <div id="map">  <img
                    src=""
                    className="GabrielNorrisImage"
                    alt="image"
                   
                  /></div>
        </div>
      </div>
    </div>
  );
};

export default Map;
